        Key Laboratory of Radioactive Waste Treatment, INET , Tsinghua University
        , Beijing , People''s Republic of China.\u000d\u000aN1  - Accession Number:
        27748641. Language: English. Date Revised: 20170726. Date Created: 20161018.
        Date Completed: 20170726. Update Code: 20171127. Publication Type: Journal
        Article. Journal ID: 9884939. Publication Model: Print-Electronic. Cited Medium:
        Internet. NLM ISO Abbr: Environ Technol. Linking ISSN: 09593330. Subset: IM;
        Date of Electronic Publication: 2016 Oct 17. Current Imprints: Publication:
        2008- : Oxford : Taylor &Francis; Original Imprints: Publication: London :
        Publications Division, Selper Ltd., 1990-\u000d\u000aAB  - In this paper,
        Fe3O4\/multi-wall carbon nanotubes composites were prepared, characterized
        and used as a catalyst for enhancing the ozonation of dimethyl phthalate (DMP)
        in aqueous solution. The experimental results showed that DMP degradation
        and mineralization increased by 26% and 20%, respectively, in catalytic ozonation
        compared with single ozonation, and more H2O2 and organic acids were produced
        during catalytic ozonation process than single ozonation. The effect of pH,
        ozone concentration and catalyst dosage on DMP degradation was determined.
        The addition of tert-butanol and phosphates showed a negative effect on DMP
        degradation, suggesting that the acidic sites on the catalyst is favorable
        to ozone decomposition to produce hydroxyl radicals. The possible mechanism
        for catalytic ozonation of DMP was tentatively proposed. The adsorption of
        ozone and organics onto the surface of catalyst could improve the DMP degradation.;
